import React from "react";
//import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from "../components/Header";
import Footer from "../components/Footer";
import Home from "../Pages/Home";
import "./App.css"

function App() {
  return (
    <React.Fragment>
      <div className="App">
        <Header />
        <Home />
        <Footer />
      </div>
    </React.Fragment>
  );
}

export default App;
